// Todo a component that creates a sidebar menu on the left side of the screen.
// The sidebar menu has a login and register button.
// The sidebar menu has a list of links to other pages.
// the sidebar is expandable and collapsable.
// The sidebar menu has a search bar.
// the sidebar menu is located at left side of the screen.



import React from "react";

export default class SidebarData extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      sidebar: false,
    };
  }

  showSidebar = () => this.setState({ sidebar: !this.state.sidebar });

  render() {
    return (
      <div>
        <div className="row">
          <div className="col-12 d-flex align-items-center">
            <div className="ms-auto">
              <button className="btn btn-primary ms-3">Login</button>
              <button className="btn btn-primary ms-3">Register</button>
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-12 d-flex align-items-center">
            <div className="ms-auto">
              <button className="btn btn-primary ms-3" onClick={this.showSidebar}>
                {this.state.sidebar ? "Collapse" : "Expand"}
              </button>
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-12 d-flex align-items-center">
            <div className="ms-auto">
              <input
                className="form-control me-2"
                type="search"
                placeholder="Search"
                aria-label="Search"
              />
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-12 d-flex align-items-center">
            <div className="ms-auto">
              <button className="btn btn-primary ms-3">Home</button>
              <button className="btn btn-primary ms-3">About</button>
              <button className="btn btn-primary ms-3">Contact</button>
            </div>
          </div>
        </div>
        {this.state.sidebar ? (
          <div className="row">
            <div className="col-12 d-flex align-items-center">
              <div className="ms-auto">
                <button className="btn btn-primary ms-3">Home</button>
                <button className="btn btn-primary ms-3">About</button>
                <button className="btn btn-primary ms-3">Contact</button>
              </div>
            </div>
          </div>
        ) : (
          <div></div>
        )}
      </div>
    );
  }
}

